import styled from "styled-components";

export const StyleMain = styled.main`
    width: 100%;
    height: 100vh;
    display: flex;
    align-items: center;
    justify-content: center;
    background: #A25858;

    padding: 30px;

    @media (min-width: 250px){
        padding: 10px;
    }

    div{
        background-color: white;
        width: 100%;
        height: 100%;
        display: flex;
        align-items: center;
        justify-content: center;

        img{
            width: 100%;
            height: 100%;
            object-fit: cover;
        }
    }


`
